    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 BETWEEN - col0 AND + col1 * + + col0 - col0 * 52;
  - name: tab1

outputs:
  - name: q1353.out
    data: |
      51	14	96
      85	5	59
      91	47	68
